import React from 'react';
import {Link} from "react-router-dom";

const AccountNavBar = () => {
    return (
        <form style={{width: 150, height: 550, border: "1px solid lightslategrey", position: "absolute", top: 55}}>
            <div>
                <Link><button>Особисті дані</button></Link>
                <Link><button>Поточне замовлення</button></Link>
                <Link><button>Історія замовлень</button></Link>
            </div>
        </form>
    );
};

export default AccountNavBar;
